pma:database.pma:trigger:
CREATE TRIGGER `books_stock_after_insert_book_user_buy` AFTER INSERT ON `book_user_buy`
 FOR EACH ROW begin
if (select number_available from book_stock where IDB=NEW.IDB)>0 then
  update book_stock set number_available=number_available-1 where IDB=NEW.IDB;
else
 delete from book_stock where IDB=NEW.IDB;
end if;

end

pma:database.pma:function:
CREATE DEFINER=`root`@`localhost` FUNCTION `user_sale`(_IDU int) RETURNS decimal(10,2)
BEGIN
declare user_login varchar (45);
declare amount int;

select login into user_login from users where IDU = _IDU;
select count(IDB) into amount from book_user_buy where IDU = _IDU group by IDU;

if user_login is not NULL then
	if amount<3 then return 0;
	elseif amount<5 then return 0.01;
	elseif amount<7 then return 0.02;
	elseif amount<10 then return 0.03;
	else return 0.05;
    end if;
else return -1;
End if;
END

pma:database.pma:procedure:
CREATE DEFINER=`root`@`localhost` PROCEDURE `add_book_user_mark`(in _IDB int, _IDU int, _page_number int, _descr text)
BEGIN
declare pages_count int default 0;
declare user_login varchar(25);
declare book_title varchar(200);

select pages into pages_count from Books where IDB=_IDB;
select title into book_title from Books where IDB=_IDB;
select login into user_login from users where IDU=_IDU;
if (_IDB is NULL) then
	Select "Enter book title" as 'Error';
elseif (_IDU is NULL) then
	Select "Enter login." as 'Error';
elseif (book_title is NULL) then 
	Select "book not found" as 'Error';
elseif (user_login is NULL) then
	Select "login not found" as 'Error';
elseif (_IDB not in (
		Select IDB from book_user_buy where idu = (
        SELECT idu FROM bookstore.users where login = (Select login from users where IDU=_IDU)))) Then
	Select "You couldn't add marks until bought book" as 'Error';
elseif (_page_number<0 OR _page_number>=pages_count) then
	Select "Check count of pages input" as 'Error';
else
	INSERT INTO book_user_mark (IDB, IDU, page_number, descr, mark_time) 
	VALUES (_IDB, _IDU, _page_number, _descr, time(now()));
end if;
END

CREATE DEFINER=`root`@`localhost` PROCEDURE `coincidence`() BEGIN
SELECT books.title, book_author.name, count(books.IDB) as "editions count", max(books.price) "max price", min(books.price) "min price" FROM books INNER JOIN book_author on books.IDB = book_author.IDB GROUP BY books.title, book_author.name HAVING count(books.IDB)>1;
END

CREATE DEFINER=`root`@`localhost` PROCEDURE `ex_transaction_1`()
BEGIN
SELECT * FROM book_stock where IDB = 859;
SELECT * FROM book_user_buy WHERE IDB=859 and IDU=1;
SET autocommit = 0;
START TRANSACTION;
    INSERT INTO book_user_buy(IDU, IDB, buy_date) values (1, 859, now());
    
    SELECT book_stock.IDB, book_stock.number_available, book_user_buy.IDU, book_user_buy.buy_date 
	FROM book_stock 
	INNER JOIN book_user_buy 
	ON book_stock.IDB = book_user_buy.IDB
	WHERE book_stock.IDB = 859 AND book_user_buy.IDU=1;
ROLLBACK;

SELECT book_stock.IDB, book_stock.number_available, book_user_buy.IDU, book_user_buy.buy_date 
FROM book_stock 
INNER JOIN book_user_buy 
ON book_stock.IDB = book_user_buy.IDB
WHERE book_stock.IDB = 859 AND book_user_buy.IDU=1;
SET autocommit = 1;
END

CREATE DEFINER=`root`@`localhost` PROCEDURE `ex_transaction_2`()
BEGIN
set autocommit = 0;
START TRANSACTION;
    INSERT INTO books(IDB, Title) values (22228, "Три мушкетёра");
    INSERT INTO book_author values (22228, "Александр Дюма");
